import React, { Component } from 'react'

class SignUp extends Component {
    render() {
        return (
            <Formik>
                <form>
                    <div className="input-row">
                            <label htmlFor="name">Name</label>
                            <input type="text" name="name" id="name" placeholder="Enter Your Name" />
                    </div>
                </form>
           </Formik>
        )
    }
}

export default SignUp
